export function toSvgUrl(images: Images): Images {
  const urlImages: Images = {};
  for (const imgId of Reflect.ownKeys(images)) {
    const value: string = Reflect.get(images, imgId);
    urlImages[imgId as string] = 'url("data:image/svg+xml,' + value + '")';
  }
  return urlImages;
}
